import { Routes, Route, Redirect } from "react-router-dom";


const privateRoute = ({children, ...rest}) => {
    const isAuthenticated = False
    return (
        <Routes>
            <Route {...rest}>{!isAuthenticated?<Redirect to='login'/> : children}</Route>
        </Routes>   
    )
}

export default privateRoute
